import reactDom from 'react-dom';
import "./index.css";

const App = () => {
    const ineve = (event) => {
        console.log(event.target.value);
    }

  
    return(
        <>
            <div>
                <h1>Hellow</h1>
                <input 
                type='text' 
                placeholder="Enter Your Name"
                onChange={ineve}/>
                <button>Submit</button>
            </div>
        </>

    );

}



export default App;
